	org &1000

start
	ld a,1
	call &BC0E		; mode 1

	LD HL, palette      ; adresse de la palette
	LD A,0              ; On commence à la couleur 0

boucle_palette
	push AF
	push HL
	LD B,(HL)       ; lire la couleur physique dans B
	LD C,(HL)       ; et C (je sais pas pourquoi)
	CALL &BC32      ; changer la couleur de A
	pop HL
	INC HL
	pop AF
	INC A
	CP 4
	JR NZ,boucle_palette

affiche_image
    ld de, &C000        ; adresse de départ écran
    ld hl, camille   ; pointeur sur l'image
    ld a, 25            ; nombre de groupes de 8 lignes (25*8=200)

affiche_groupe_8_lignes
    push af             ; sauvegarder compteur groupes
    ld b, 8             ; 8 lignes par groupe
    
affiche_une_ligne
    push bc
    ld bc, 80           ; 80 octets par ligne
    ldir                ; copier la ligne
    
    ; Passer à la ligne suivante dans le groupe
    push hl             ; sauvegarder HL
    ld hl, &07B0        ; offset pour ligne suivante
    add hl, de          ; HL = adresse ligne suivante
    ex de, hl           ; DE = nouvelle adresse écran
    pop hl              ; restaurer pointeur image

    pop bc
    djnz affiche_une_ligne

    ; Fin du groupe de 8, revenir en arrière
    push hl
    ld hl, -&3FB0  	; revenir en arrière de &3F0
    add hl, de
    ex de, hl
    pop hl
    
    pop af
    dec a
    jr nz, affiche_groupe_8_lignes
    ret

palette
	db 7,6,3,15

camille
